#include <stdio.h>

// Recursive function to calculate the nth term
int S(int n, int a, int b, int c) {
    if (n == 1)
        return a;
    else if (n == 2)
        return b;
    else if (n == 3)
        return c;
    else
        return S(n - 1, a, b, c) + S(n - 2, a, b, c) + S(n - 3, a, b, c);
}

int main() {
    int n, a, b, c;
    
    // Reading input
    scanf("%d", &n);
    scanf("%d %d %d", &a, &b, &c);
    
    // Printing the nth term
    printf("%d\n", S(n, a, b, c));

    return 0;
}

