}

#include <stdio.h>

int main() {
    int n, i;
    
    // Input the size of arrays
    scanf("%d", &n);

    // Declare arrays
    int A[n], B[n];
    int Sum[n], Diff[n], Prod[n];
    float Div[n]; // float for division result

    // Input elements for array A
    for (i = 0; i < n; i++) {
        scanf("%d", &A[i]);
    }

    // Input elements for array B
    for (i = 0; i < n; i++) {
        scanf("%d", &B[i]);
    }

    // Perform arithmetic operations
    for (i = 0; i < n; i++) {
        Sum[i] = A[i] + B[i];
        Diff[i] = A[i] - B[i];
        Prod[i] = A[i] * B[i];

        if (B[i] != 0) {
            Div[i] = (float)A[i] / B[i];
        } else {
            Div[i] = 0.0; // handle division by zero
        }
    }

    // Output the results
    printf("\nSum: ");
    for (i = 0; i < n; i++) {
        printf("%d ", Sum[i]);
    }

    printf("\nDiff: ");
    for (i = 0; i < n; i++) {
        printf("%d ", Diff[i]);
    }

    printf("\nProd: ");
    for (i = 0; i < n; i++) {
        printf("%d ", Prod[i]);
    }

    printf("\nDiv: ");
    for (i = 0; i < n; i++) {
        printf("%.2f ", Div[i]);  // formatted to 2 decimal places
    }

    printf("\n");

    return 0;
}

