def is_prime(n):
    """
    Return True if n is prime, False otherwise.
    """
    if n < 2:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    # check odd divisors up to sqrt(n)
    p = 3
    while p * p <= n:
        if n % p == 0:
            return False
        p += 2
    return True

# Print primes from 100 to 500
for num in range(100, 501):
    if is_prime(num):
